['Acuerdo entre el MIDES y el Ministerio de Educacin (MEDUCA) para el fortalecimiento de la oferta de servicios para los beneficiarios de los programas del MIDES y para facilitar el cumplimiento de las corresponsabilidades de los beneficiaries. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Acuerdo entre el MIDES y el Ministerio de Salud (MINSA) para el fortalecimiento de la oferta de servicios para los beneficiarios de los programas del MIDES y para facilitar el cumplimiento de las corresponsabilidades de los beneficiaries. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Ayuda Memoria del Comit Tcnico de la CONAIPI que aprueba el Manual Operativo del Programa de Atencin Integral a la Infancia Cuidarte para reas comarcales y rurales dispersas. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Circular del MINSA que documente que se est utilizando la Libreta del Nio para al menos veinte mil (20.000) nios o madres gestantes. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Decreto Ejecutivo que asigna al MIDES la competencia como entidad rectora y supervisora de los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Estndares de Calidad para los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Ley que establece el marco legal de los programas de transferencias monetarias y que crea el Registro nico de los Beneficiarios de dichos programas y la plataforma nica para el pago de las transferencias.
La Ley establece, entre otros: (i) la facultad del Ministerio de Desarrollo Social (MIDES), como ente rector de la poltica social, de reglamentar los mecanismos de identificacin de la poblacin en pobreza y pobreza extrema, as como los criterios e intervalos para la recertificacin de dicha poblacin; (ii) que dichos mecanismos de identificacin y recertificacin sean aplicados a los programas de transferencias monetarias existentes o que se implementen en el futuro; (iii) el reconocimiento de la Red de Oportunidades (RdO) como programa de transferencia monetaria del gobierno. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Manual Operativo del Programa de Atencin Integral a la Infancia Cuidarte para reas comarcales y rurales dispersas. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Manual operativo del programa 120 a los 65 que incluya los nuevos criterios de focalizacin y recertificacin. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Manual operativo del programa Red de Oportunidades que incluya los nuevos criterios de focalizacin y recertificacin. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Manual operativo del programa ngel Guardin que incluya los nuevos criterios de focalizacin y recertificacin. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Marco de polticas macroeconmicas adecuado PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Nota del MIDES que documente los avances en el rediseo de la estructura de la trasferencia monetaria de la Red de Oportunidades, que incluya al menos una de las siguientes variables: nmero de personas, ciclo educativo, nivel de pobreza. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Nota del MIDES que documente que se ha avanzado en la implementacin gradual del mecanismo de pago por resultados y de financiamiento per cpita para los proveedores pblicos y privados que administran los Centros de Orientacin Infantil y Familiar (COIF), por medio de la licitacin de la auditora operativa y de la licitacin de la entidad fiduciaria. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Nota del MIDES que documente que se ha avanzado en la implementacin gradual del mecanismo de pago por resultados y de financiamiento per cpita para los proveedores pblicos y privados que administran los Centros de Orientacin Infantil y Familiar (COIF), por medio de la remisin a Contralora del Reglamento Operativo del Modelo de Atencin Integral a la Primera Infancia para los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Nota del Ministerio de Desarrollo Social que documenta los avances en la racionalizacin de los procesos operativos del Bono Nutricional Alimenticio (BNA) y la Red de Oportunidades mediante la unificacin de los padrones de beneficiarios de los dos programas. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Nota del Ministerio de Desarrollo Social que documenta que la Direccin de Inclusin y Desarrollo Social del MIDES est en funcionamiento, cumplimiento con su funcin de gerencia de los programas de proteccin social. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Nota del Ministerio de Desarrollo Social que documenta:
1. que se est utilizando la ficha nica de proteccin social para evaluar la entrada y permanencia de los beneficiarios de los programas Red de Oportunidades, 120 a los 65 y ngel Guardin;
2. el uso del nuevo mecanismo de identificacin de la poblacin en pobreza y pobreza extrema (nuevo proxy, con base en la nueva Ficha nica de Proteccin Social) para evaluar la solicitud de nuevos postulantes a los programas Red de Oportunidades, 120 a los 65 y ngel Guardin;
3. la recertificacin de 21.561 beneficiarios de la Red de Oportunidades y 120 a los 65 usando el nuevo mecanismo de focalizacin. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Oficio del MEF que evidencia la reduccin por un monto de ms de B./20 millones en el gasto de subsidios generalizados y el incremento por un monto de ms de B./20 millones en el presupuesto del MIDES para los programas Red de Oportunidades, 120 a los 65 y ngel Guardin. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Reglamento Operativo del Modelo de Atencin Integral a la Primera Infancia para los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Resolucin Ministerial del MIDES que aprueba los Estndares de Calidad para los CAIPI (antes COIF). PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Resolucin del Instituto para la Formacin y Aprovechamiento de Recursos Humanos que aprueba el nuevo Manual de Procedimientos de la Beca Universal que incorpora los criterios de priorizacin establecidos por el MIDES. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama', 'Resolucin del Ministerio de Desarrollo Social que:
1. aprueba el nico puntaje para clasificar a los postulantes y beneficiarios de Red de Oportunidades, 120 a los 65 y ngel Guardin como pobres o pobres extremos, de forma coherente con la definicin de pobreza del Ministerio de Economa y Finanzas (MEF);
2. define los criterios de priorizacin para los programas de corte universal;
3. aprueba los los Manuales Operativos de los programas Red de Oportunidades, 120 a los 65 y ngel Guardin que incluyen los criterios de focalizacin y recertificacin. PROGRAMA DE TRANSPARENCIA Y EQUIDAD DEL GASTO EN PROTECCIN SOCIAL II Panama']
